import React from 'react';

function About_Page(){
    return(
        <>
        <div className='container text-center'>
            <h1 className='text-white my-5'>Read Our Documentation</h1>
            <iframe src="https://drive.google.com/file/d/1H5LWoQBi0nlKHzQNHl85xwsOl263mAjC/preview" width="640" height="900" allow="autoplay"></iframe>
        </div>
        </>
    )
}

export default About_Page;
